INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "アヤネ", "2020/07/31 12:00:00", 24001, 24, 10046, 0.0, 401, 2, 102301, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "アヤネ", "2020/07/31 12:00:00", 24002, 24, 10046, 0.0, 402, 2, 102301, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2030/12/17 14:59:59", 2.21);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "アヤネ", "2020/07/31 12:00:00", 24003, 24, 10046, 0.0, 403, 2, 102301, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "アサヒ", "2020/07/31 12:00:00", 24004, 24, 10046, 0.0, 701, 1, 192201, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2030/12/17 14:59:59", 1.99);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "アサヒ", "2020/07/31 12:00:00", 24005, 24, 10046, 0.0, 702, 2, 192201, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2030/12/17 14:59:59", 2.21);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "アサヒ", "2020/07/31 12:00:00", 24006, 24, 10046, 0.0, 703, 1, 192201, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2030/12/17 14:59:59", 3.33);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "部員３", "2020/07/31 12:00:00", 24007, 24, 10046, 0.0, 801, 2, 192301, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "部員３", "2020/07/31 12:00:00", 24008, 24, 10046, 0.0, 802, 2, 192301, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2030/12/17 14:59:59", 2.68);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "部員３", "2020/07/31 12:00:00", 24009, 24, 10046, 0.0, 803, 2, 192301, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "", "2020/07/31 12:00:00", 24010, 24, 10046, 0.0, 501, 1, 192501, 0.0, "やった！", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "", "2020/07/31 12:00:00", 24011, 24, 10046, 0.0, 502, 1, 192501, 0.0, "勝ったよ！", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "", "2020/07/31 12:00:00", 24012, 24, 10046, 0.0, 503, 1, 192501, 0.0, "いい調子！", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (6, "ミサト", "2020/07/31 12:00:00", 24013, 24, 10046, 0.0, 111, 2, 113501, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2030/12/17 14:59:59", 5.33);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "ミサト", "2020/07/31 12:00:00", 24014, 24, 10046, 0.0, 112, 2, 113501, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2030/12/17 14:59:59", 6.85);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "ミサト", "2020/07/31 12:00:00", 24015, 24, 10046, 0.0, 113, 2, 113501, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2030/12/17 14:59:59", 3.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "ダイチ", "2020/07/31 12:00:00", 24016, 24, 10046, 0.0, 611, 2, 192401, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2030/12/17 14:59:59", 6.11);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "ダイチ", "2020/07/31 12:00:00", 24017, 24, 10046, 0.0, 612, 2, 192401, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2030/12/17 14:59:59", 6.75);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "ダイチ", "2020/07/31 12:00:00", 24018, 24, 10046, 0.0, 613, 2, 192401, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "ハツネ", "2020/07/31 12:00:00", 24019, 24, 10046, 0.0, 211, 1, 113401, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2030/12/17 14:59:59", 4.52);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "ハツネ", "2020/07/31 12:00:00", 24020, 24, 10046, 0.0, 212, 1, 113401, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2030/12/17 14:59:59", 3.89);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "ハツネ", "2020/07/31 12:00:00", 24021, 24, 10046, 0.0, 213, 2, 113401, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2030/12/17 14:59:59", 13.49);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "カヤ", "2020/07/31 12:00:00", 24022, 24, 10046, 0.0, 311, 2, 106501, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2030/12/17 14:59:59", 3.17);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "カヤ", "2020/07/31 12:00:00", 24023, 24, 10046, 0.0, 312, 2, 106501, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2030/12/17 14:59:59", 4.42);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (6, "カヤ", "2020/07/31 12:00:00", 24024, 24, 10046, 0.0, 313, 1, 106501, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2030/12/17 14:59:59", 2.89);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (4, "アヤネ", "2020/07/31 12:00:00", 24025, 24, 10046, 0.0, 421, 3, 102301, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2030/12/17 14:59:59", 3.71);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "アサヒ", "2020/07/31 12:00:00", 24026, 24, 10046, 0.0, 721, 1, 192201, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2030/12/17 14:59:59", 5.1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "部員３", "2020/07/31 12:00:00", 24027, 24, 10046, 0.0, 821, 3, 192301, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2030/12/17 14:59:59", 4.34);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "", "2020/07/31 12:00:00", 24028, 24, 10046, 0.0, 521, 1, 192501, 0.0, "いい勝負だったよ\nまたやろうね", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "ミサト", "2020/07/31 12:00:00", 24029, 24, 10046, -360.0, 101, 2, 113501, 0.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2030/12/17 14:59:59", 5.62);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "ミサト", "2020/07/31 12:00:00", 24030, 24, 10046, -360.0, 102, 2, 113501, 0.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2030/12/17 14:59:59", 9.58);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "ミサト", "2020/07/31 12:00:00", 24031, 24, 10046, -360.0, 103, 2, 113501, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (2, "ミサト", "2020/07/31 12:00:00", 24032, 24, 10046, -360.0, 104, 1, 113501, 0.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2030/12/17 14:59:59", 9.13);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (1, "ミサト", "2020/07/31 12:00:00", 24033, 24, 10046, -360.0, 105, 2, 113501, 0.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2030/12/17 14:59:59", 8.27);
